CREATE TABLE orders (
	order_id varchar NOT NULL,
	order_date date NULL,
	ship_date date NULL,
	ship_mode varchar NULL,
	customer_id varchar NULL,
	postal_code varchar NULL,
	product_id varchar NULL,
	sales float8 NULL,
	quantity int4 NULL,
	discount numeric NULL,
	profit float8 NULL,
	row_id int4 NULL
);

